INSERT INTO `blogs` VALUES (1,'Sejarah Sarung','','<p>\n<style type=\"text/css\">\np { margin-bottom: 0.21cm; }a:link {  }</style>\n</p>\n<p style=\"margin-bottom: 0cm;\">\n<font face=\"Arial, sans-serif\">Sarung sudah lekat dengan ciri khas masyarakat muslim di Indonesia. Walau sesungguhnya pemakain sarung tak menunjuk pada identitas agama tertentu. Karena sarung juga digunakan oleh berbagai kalangan di berbagai suku yang ada.</font></p>\n<p style=\"margin-bottom: 0cm;\">\n<font face=\"Arial, sans-serif\">Sarung pertama kali masuk ke Indonesia pada abad ke 14, dibawa oleh para saudagar Arab dan Gujarat. Kita tahu bahwa pada awal kejayaan Islam, produksi tekstil sangatlah melonjak dan menjadi komoditi industri pertama. </font><font face=\"Arial, sans-serif\"><i>Kain sarung </i></font><font face=\"Arial, sans-serif\">adalah salah satu produk bahan tekstil yang tetap tak lekang ditelan zaman hingga hari ini. </font></p>\n<p style=\"margin-bottom: 0cm;\">\n<font face=\"Arial, sans-serif\">Yaman kemudian disebut-sebut yang pertama kali membudayakan sarung. Di sana, sarung dikenal dengan sebutan </font><font face=\"Arial, sans-serif\"><i>futah</i></font><font face=\"Arial, sans-serif\">. Sementara, dalam terminologi bahasa Arab, sarung disebut dengan nama </font><font face=\"Arial, sans-serif\"><i>izaar</i></font><font face=\"Arial, sans-serif\"> dan marak berkembang di seluruh benua di dunia, termasuk Indonesia. Penggunaa sarung pun mulai meluas, bukan hanya pada persoalan ibadah semata. Pesta pernikahan dan tradisi adat lainnya kerap juga menggunakan sarung.</font></p>\n<p style=\"margin-bottom: 0cm;\">\n<font face=\"Arial, sans-serif\">Di Indonesia, sarung sudah menjadi busana kehormatan dan standar kesopanan. Ini terbukti saat warga Indonesia, khususnya kaum muslimin, mengenakan sarung pada saat beribadah menghadap Tuhan. Bahkan, ada juga yang memakai sarung sebagai bentuk perlawanan pada maraknya budaya barat yang mengepung.</font></p>',NULL,'wadimor',NULL,'1','1','puji','2014-03-06 20:36:15'),(2,'Proses Produksi','<p>\n&nbsp;</p>\n<p style=\"margin-bottom: 0cm\">\n<font face=\"Arial, sans-serif\">Pemilihan bahan sangat berpengaruh pada bagus atau tidaknya sarung yang dihasilkan. </font><font face=\"Arial, sans-serif\"><b>Sarung WADIMOR</b></font><font face=\"Arial, sans-serif\"> dibuat dari benang pilihan yang diproduksi sendiri dan diproses menggunakan mesin berteknologi canggih. Setiap tahapan produksi melalui seleksi kualitas yang sangat ketat, sehingga menghasilkan kualitas sarung yang cemerlang, tidak luntur dan tidak kusam.</font></p>','<p>\n&nbsp;</p>\n<p style=\"margin-bottom: 0cm\">\n<font face=\"Arial, sans-serif\">Pemilihan bahan sangat berpengaruh pada bagus atau tidaknya sarung yang dihasilkan. </font><font face=\"Arial, sans-serif\"><b>Sarung WADIMOR</b></font><font face=\"Arial, sans-serif\"> dibuat dari benang pilihan yang diproduksi sendiri dan diproses menggunakan mesin berteknologi canggih. Setiap tahapan produksi melalui seleksi kualitas yang sangat ketat, sehingga menghasilkan kualitas sarung yang cemerlang, tidak luntur dan tidak kusam.</font></p>',NULL,'wadimor',NULL,'1','1','puji','2014-03-06 20:36:15'),(3,'Motif dan Corak','<p>\n&nbsp;</p>\n<p style=\"margin-bottom: 0cm\">\n<font face=\"Arial, sans-serif\">Desainer sarung Wadimor sangat berpengalaman, menjadikan </font><font face=\"Arial, sans-serif\"><b>Sarung WADIMOR </b></font><font face=\"Arial, sans-serif\">kaya akan motif dan corak. Perpaduan warnanya serasi dan indah.</font></p>','<p>\n&nbsp;</p>\n<p style=\"margin-bottom: 0cm\">\n<font face=\"Arial, sans-serif\">Desainer sarung Wadimor sangat berpengalaman, menjadikan </font><font face=\"Arial, sans-serif\"><b>Sarung WADIMOR </b></font><font face=\"Arial, sans-serif\">kaya akan motif dan corak. Perpaduan warnanya serasi dan indah.</font></p>',NULL,'wadimor',NULL,'1','1','puji','2014-03-06 20:36:15'),(4,'Sukorintex','<p>\n&nbsp;</p>\n<p style=\"margin-bottom: 0cm\">\n<font face=\"Arial, sans-serif\"><b>PT. SUKORINTEX</b></font><font face=\"Arial, sans-serif\"> yang berlokasi di Batang Jawa Tengah adalah produsen dari </font><font face=\"Arial, sans-serif\"><b>Sarung</b></font><font face=\"Arial, sans-serif\"> </font><font face=\"Arial, sans-serif\"><b>WADIMOR</b></font><font face=\"Arial, sans-serif\">. Dengan perpaduan para desainer handal, tenaga ahli mesin tenun, karyawan yang sangat berpengalaman dan mesin berteknologi canggih mampu menghasilkan sarung yang sangat berkualitas, nyaman dipakai, motif dan corak yang beragam.</font></p>','<p>\n&nbsp;</p>\n<p style=\"margin-bottom: 0cm\">\n<font face=\"Arial, sans-serif\"><b>PT. SUKORINTEX</b></font><font face=\"Arial, sans-serif\"> yang berlokasi di Batang Jawa Tengah adalah produsen dari </font><font face=\"Arial, sans-serif\"><b>Sarung</b></font><font face=\"Arial, sans-serif\"> </font><font face=\"Arial, sans-serif\"><b>WADIMOR</b></font><font face=\"Arial, sans-serif\">. Dengan perpaduan para desainer handal, tenaga ahli mesin tenun, karyawan yang sangat berpengalaman dan mesin berteknologi canggih mampu menghasilkan sarung yang sangat berkualitas, nyaman dipakai, motif dan corak yang beragam.</font></p>\n<p style=\"margin-bottom: 0cm\">\n<font face=\"Arial, sans-serif\">Kualitas </font><font face=\"Arial, sans-serif\"><b>sarung WADIMOR </b></font><font face=\"Arial, sans-serif\">yang istimewa juga sangat dipengaruhi oleh benang yang diproduksi sendiri dibawah naungan bendera </font><font face=\"Arial, sans-serif\"><b>PT. SUBA SPINNING MILLS. </b></font><font face=\"Arial, sans-serif\">Proses produksi menggunakan mesin berteknologi canggih sehingga kualitas produksinya benar-benar berkualitas dan terkontrol.</font></p>\n<p style=\"margin-bottom: 0cm\">\n<font color=\"#181512\"><font face=\"Arial, sans-serif\">Dengan sistem distribusi yang baik, saat ini sarung </font></font><font color=\"#181512\"><font face=\"Arial, sans-serif\"><b>WADIMOR</b></font></font><font color=\"#181512\"><font face=\"Arial, sans-serif\"> sudah terkenal dan tersebar luas di </font></font><font color=\"#181512\"><font face=\"Arial, sans-serif\"><i>Indonesia, Singapura, Malaysia, Brunei, Thailand, Saudi Arabia, UEA (Abu Dhabi, Ajman, Dubai, Fujairah, Ras al-Khaimah, Sharjah dan Umm al-Qaiwain), Yaman, Somalia, Djibouti, Sudan, Afghanistan</i></font></font><font color=\"#181512\"><font face=\"Arial, sans-serif\"> dll.</font></font></p>',NULL,'wadimor',NULL,'1','1','puji','2014-03-06 20:36:15'),(5,'Kualitas','<p>\n&nbsp;</p>\n<p style=\"margin-bottom: 0cm\">\n<font face=\"Arial, sans-serif\">Dengan pemakaian bahan yang baik dipadu dengan mesin berteknologi canggih dan diproduksi sendiri, benang yang dihasilkan sangatlah istimewa, sehingga proses pembuatan sarung dapat menghasilkan sarung yang bagus, halus, nyaman dipakai, warnanya cemerlang dan tidak luntur. &nbsp;</font></p>','<p>\n&nbsp;</p>\n<p style=\"margin-bottom: 0cm\">\n<font face=\"Arial, sans-serif\">Dengan pemakaian bahan yang baik dipadu dengan mesin berteknologi canggih dan diproduksi sendiri, benang yang dihasilkan sangatlah istimewa, sehingga proses pembuatan sarung dapat menghasilkan sarung yang bagus, halus, nyaman dipakai, warnanya cemerlang dan tidak luntur. &nbsp;</font></p>',NULL,'wadimor',NULL,'1','1','puji','2014-03-06 20:36:15'),(6,'Ragam Produk','','',NULL,'wadimor',NULL,'1','1','puji','2014-03-06 20:36:15'),(7,'Seputar Wadimor','<p>\n	<font face=\"Arial, sans-serif\">Acara TV Damai Indonesiaku di TV One ditayangkan setiap hari Sabtu dan Minggu jam 13.00-15.00 wib dipersembahkan oleh </font><font face=\"Arial, sans-serif\"><b>Sarung Wadimor</b></font><font face=\"Arial, sans-serif\"><i>. ( insert foto acara Damai Indonesiaku TV One)</i></font></p>\n','<p>\n	<b style=\"font-family: Arial, sans-serif;\">Sponsorship Damai Indonesiaku.</b></p>\n<p style=\"margin-bottom: 0cm\">\n	<font face=\"Arial, sans-serif\">Acara TV Damai Indonesiaku di TV One ditayangkan setiap hari Sabtu dan Minggu jam 13.00-15.00 wib dipersembahk